message:
🇧🇷 — Um breve resumo da polêmica que rolou esta noite:

 • Líder indígena Xavante, Sererê, fez pedido de prisão contra Alexandre de Moraes (STF) por abuso de autoridade.  Sererê virou símbolo dos movimentos contra o presidente eleito Lula (PT);

 • Na noite de hoje (12 de dezembro de 2022), Sererê foi abordado pela polícia, agredido fisicamente e levado inconsciente para o prédio da Polícia Federal;

 • Manifestantes se mobilizaram em massa para ficar em frente ao prédio e se revoltam contra a agressão e prisão do indígena, gerando uma discussão entre manifestantes e policiais.

 A noite será longa.
